myQuran application is your universal assistant, which allows you to benefit from reading and listening to the Quran. myQuran will always be at your fingertips, wherever you are.

Features:

— Translation into 25 languages;
— Tafsir - interpretation of the Quran;
— Original Quran text with tajweed rules;
— Detailed information for each surah;
— Screen with Ajza;
— Easy to use and functional audio player;
— Ability to play each ayah separately (for 11 recitors);
— Interactive surah and ayah search; 
— Ability to add ayahs to favourites;
— Bookmarks;
— Custom font and font sizes;
— Quick access toolbar on the main screen;
— Ability to delete cached audio files;
— Customizable notifications;
— 3D touch support;

Please keep in mind, that you can share ayahs using e-mail, SMS, Facebook, Twitter, WhatsApp, Telegram, VK and other social networks. 

The application allows you to listen to Quran recitation with the voices of the best reciters in the world. Such as: Abdul Baset Abdus Samad; Abdul Rahman al-Sudais; Abdullah Awad al-Juhani; Abdullah Ibn Ali Basfar; Abu Bakr ash-Shatri; Ahmad bin Ali al-Ajmi; Emad al-Mansary; Hani ar-Rifai; Maher al-Muaiqly; Mahmood al-Rifai; Mahmoud Khalil al-Hussary; Mishari Rashid al-Afasy; Muhammad al-Luhaidan; Muhammad al-Minshawi; Nasser al-Qatami; Saad al-Ghamdi; Salah Abdul Rahman Bukhatir; Salah al-Budair; Salah al-Hashim; Saud al-Shuraim; Tawfeeq al-Sayegh; Yasser al-Dosari.

Please write your reviews and suggestions to support@myquran.me. We appreciate your opinion!

OFFLINE photo translator and dictionary -- the ultimate foreign language tool when you are abroad! 
Translates sentences and photos without data connection between English, Chinese, Spanish, French, German, Italian, Turkish and Bulgarian in offline mode. A must have if you travel to foreign countries - save on data roaming charges!

Our unique translation technology often delivers translations that excel both Google Translate and Microsoft Translator while using much less storage space.
It also allows more language pairs than other paid apps having offline translation such as iTranslate.

FREE VERSION
- you will be reminded to support us by using one of our paid apps;
- you will be able to try 50 times the functionality of the full app (voice output and photo translation);

TRANSLATION
- translates from and to English, Chinese, Spanish, French, German, Italian, Turkish and Bulgarian;
- full-text translation without any internet connection;
- automatically detects input language;
- second language button (in the upper left corner) and swap languages button (in the top center of the screen) for easy swapping between the two languages.

PHOTO / PICTURE TRANSLATION AND OCR
- take a picture of printed text and translate it in seconds offline! 
- available for English, Chinese, German, French, Italian, Spanish, Turkish and Bulgarian;
- use this feature to easily convert photos of printed text into editable text in offline mode; 

VOICE / SPEECH
- voice / speech output for French, German, Italian, Spanish, English, Chinese, Bulgarian and Turkish*;
- allows reading individual words by tapping the desired word in the translation;

DICTIONARY
- dictionary between English, Chinese, Spanish, Turkish, German, French, Italian and Bulgarian;
- recognizes any word form and identifies its features (number, person, gender, etc.)
- displays all the translations for a given word;
- displayed for single words when hitting the Translate button;
- allows reading individual words by tapping the desired word in the translation;

You can test the app performance by getting the free version, Offline Translator 8 or online at http://offline-translator.com

If you encounter problems with the app, please contact our customer support at auser@skycode.com !

*Turkish is not supported on iOS 6.*
